$templateCache.put("core/tourism/city-council-contact.tpl.html","<ion-view view-title=\"Contactos\">\r\n        <ion-content has-header=\"true\" padding=\"false\">\r\n        <div class=\"list cards padding\">\r\n            <div class=\"item item-divider\">\r\n                Município de Viseu\r\n            </div>\r\n        	<div class=\"item item-text-wrap item-icon-left\">\r\n               <i class=\"icon ion-map\"></i>\r\n               Praça da República 3514-501 Viseu\r\n            </div>\r\n            <div class=\"item item-text-wrap item-icon-left\">\r\n               <i class=\"icon ion-map\"></i>\r\n               geral@cmviseu.pt\r\n            </div>\r\n            <div class=\"item item-text-wrap item-icon-left\">\r\n               <i class=\"icon ion-map\"></i>\r\n               232 427 427\r\n            </div>\r\n            <div class=\"item item-divider\">\r\n               Apoio ao Munícipe\r\n            </div>\r\n            <div class=\"item item-text-wrap item-icon-left\">\r\n               <i class=\"icon ion-map\"></i>\r\n               apoiomunicipe@cmviseu.pt\r\n            </div>\r\n            <div class=\"item item-text-wrap item-icon-left\">\r\n               <i class=\"icon ion-map\"></i>\r\n              232 426 745\r\n            </div>\r\n        </div>\r\n    </ion-content>\r\n</ion-view>");
$templateCache.put("core/tourism/gastronomy.tpl.html","<ion-view view-title=\"Gastronomia\">\r\n    <ion-content has-header=\"true\" padding=\"false\">\r\n        <div class=\"list card\">\r\n    	<div class=\"item item-text-wrap\">\r\n            <p>Em terras de Viriato, cultiva-se a arte de bem receber e servir. Rica e variada, tipicamente beirã, a gastronomia viseense é um dos grandes atrativos da região. Pratos encorpados, petiscos variados e doces de apaziguar os paladares mais exigentes integram um menu irresistível, a não perder de vista nos inúmeros restaurantes da região.</p>\r\n            <p>O <strong>Rancho à Moda de Viseu </strong>é o ex-líbris da cidade e, talvez, o prato mais conhecido. Reza a história que a famosa iguaria viseense nasceu em tempos conturbados da guerra entre liberais e absolutistas, no Regimento de Infantaria nº14. Nessa altura, a urgência em garantir a alimentação dos soldados levou o cozinheiro a elaborar um prato com todos os ingredientes que se encontravam à disposição. Da carne de galinha, porco e vaca, dos enchidos, grão-de-bico, batatas, macarrão e couves surgiu uma comida encorpada e calórica que garantiu a resistência dos militares sob as adversidades bélicas.</p>\r\n            <p>Esta é também a terra da famosa <strong>Vitela Assada à Lafões, </strong>do <strong>Arroz de Carqueja, </strong>do <strong>Entrecosto com Chouriço e Grelos</strong>, do <strong>Cozido à Portuguesa</strong> e do <strong>Cabrito Assado</strong>.</p>\r\n            <p>No que respeita à doçaria, o <strong>Viriato</strong> é rei. O seu aspeto em forma de “V” espicaça a curiosidade de todos os turistas, miúdos e graúdos, que não resistem ao sabor inconfundível do bolo, presença obrigatória em diversas pastelarias e confeitarias da cidade. A origem da receita original do Viriato, permanece, até aos dias de hoje, um mistério. Alguns mencionam que ela poderá ter chegado, há mais de 50 anos atrás, pelas mãos de um grupo de pasteleiros oriundos de Lisboa. Outros apontam-na como receita viseense, criada por uma senhora residente na Casa das Bocas, na Rua João Mendes. É o caso da Confeitaria Amaral, que segue esta mesma receita, por eles registada. Independentemente das origens, a verdade é que uma visita a Viseu é sinónimo de uma prova, ainda que a correr, do doce típico.</p>\r\n            <p>As <strong>Castanhas de Ovos de Viseu</strong> e os <strong>Pastéis de Feijão</strong> fazem também parte desta “montra gulosa”.</p>\r\n            <p>Por último, de destacar a “cereja no topo do bolo”: os <strong>Vinhos do Dão</strong>. Maduros, de aromas frutados, provenientes da Região Demarcada do Dão, a excecionalidade destes néctares são um cartão-de-visita obrigatório, para experienciar com toda a calma e tranquilidade, a acompanhar uma refeição ou até mesmo para desfrutar ao final do dia.</p>\r\n        </div>\r\n        </div>\r\n    </ion-content>\r\n</ion-view>");
$templateCache.put("core/tourism/history.tpl.html","<ion-view view-title=\"Historia\">\r\n        <ion-content has-header=\"true\" padding=\"false\">\r\n        <div class=\"list card\">\r\n    	<div class=\"item item-text-wrap\">\r\n            <p>As origens de Viseu, antiga e nobilíssima cidade, perdem-se nas brumas do tempo.</p>\r\n            <p>Aqui estanciaram homens das Idades remotas da pré-história e conviveram Celtas e Lusitanos. Aqui se fixaram os Romanos em séculos de prosperidade e paz e por aqui passaram com maior ou menor detença hordas dos povos invasores: Suevos, Godos e Muçulmanos.</p>\r\n            <p>No tempo dos Suevos, em meados do século VI, já Viseu tinha os seus bispos. Mais tarde, porém, com a chegada dos Muçulmanos e a derrocada do reino visigodo, o receio das violências dos infiéis obrigou-os a tomar o caminho do exílio e a refugiar-se nas longínquas montanhas das Astúrias. Seguiu-se um longo período nebuloso e trágico, raramente clareado por breves lampejos de paz.</p>\r\n            <p>Mudando frequentemente de mãos, ora em poder de cristãos, ora de maometanos, apenas no ano 1058 a cidade de Viseu, graças à arremetida vitoriosa de Fernando Magno, rei de Leão, logrou recuperar, definitivamente, a sua liberdade. Mas tão desmantelada ficou e foram tão fundas as feridas da rude ofensiva leonesa, que somente em 1147/1148, cem anos após a reconquista, estava a Diocese em condições de sustentar um bispo próprio. Durante tão longo interregno pontifical, foi a Diocese governada pelos Bispos de Coimbra, por intermédio de Priores, o mais célebre dos quais, pelas suas virtudes, foi S. Teotónio, patrono atual da Cidade.</p>\r\n            <p>Afastado para longe o perigo das razias mauritanas, pôde a população, enfim, radicar-se sem sobressaltos e a Cidade refazer-se das cicatrizes e prosperar, de tal modo que, segundo Jaime Cortesão, foi Viseu um desses velhos centros urbanos que \" rapidamente recuperaram o brilho transitoriamente perdido ou recrudesceram em atividade e diferenciação social \". Foram mais de três séculos de paz laboriosa e fecunda, brutalmente quebrada por fim, após 1383, quando, morto El-rei D. Fernando, o rei de Castela tentou fazer valer, pela força das armas, os seus direitos ao trono de Portugal. Então por ter seguido o partido do Mestre de Avis, passou Viseu a ser um dos alvos preferidos dos \" corredores \" castelhanos: mais de uma vez saqueada e queimada, a população escapou por milagre à chacina, barricando-se na Sé.</p>\r\n            <p>Cidade indefesa, à mercê das investidas castelhanas, foi das terras portuguesas que mais sofreu, para que Portugal continuasse livre. Teimou em sobreviver qual nova \" fénix \", ressurgiu das próprias cinzas mal começava a despertar no horizonte a alvorada de concórdia entre as duas nações peninsulares.</p>\r\n            <p>Protegida por uma cinta de muralhas, servida por sete portas, a cidade desenvolveu-se como nunca, alindou-se. Levantou as abóbadas da Catedral, chamou Grão Vasco para seu vizinho e, orgulhosa de si, mandou esculpir nos portais, nas janelas e nas cornijas das suas casas, em custosos e artísticos lavores, os sinais da sua prosperidade. É por isso que a cidade de Viseu pode justamente orgulhar-se de possuir, ainda hoje, um dos mais belos conjuntos do país, de casas, portais e janelas dos estilo gótico e manuelino, dispersos um pouco por todos os recantos, sobretudo nas típicas ruazinhas aconchegadas à Catedral.</p>\r\n            <p>Dada a perda da independência com a Batalha de Alcácer Quibir, a nação ficaria gravemente ferida, sem rei e sem honra. Porém, a partir de 1 de Dezembro de 1640 renasce com o ouro e pedrarias raras provenientes dos descobrimentos nos confins do Brasil.</p>\r\n            <p>Uma febre alta de renovação iria agora contagiar o país de lés-a-lés. Os artífices dos mais variados mesteres não terão mais os braços ociosos, insistentemente requeridos aqui e ali, presos aos seus compromissos. Capelas, igrejas, fontanários e velhos solares musguentos e bisonhos, alguns do tempo dos afonsinhos, tudo se refez ao impulso do novo estilo, com janelas de molduras e aventais lavrados, amplos salões luminosos, fortes cornijas onde antes, urnas e pináculos esquisitos implantados nos cunhais, gordas pedras de armas arrogantes, pesadamente coroadas.</p>\r\n            <p>Viseu, cidade de existência mais que milenária, não podia deixar de refletir no seu rosto vetusto o testemunho da passagem das sucessivas gerações e estilos artísticos. E eles aí estão, de facto, tais testemunhos: monumentos artísticos de todas as idades, felizmente poupados ao impiedoso desgaste dos séculos.</p>\r\n        </div>\r\n        </div>\r\n    </ion-content>\r\n</ion-view>");
